def corrcoeff_function(a, b):
    corrcoeff = np.corrcoef(a, b)
    return corrcoeff
corrcoeff_has_transaction_age = corrcoeff_function(data['has_transaction'], data['Age']) [0, 1]
corrcoeff_has_transaction_age = corrcoeff_has_transaction_age.round(2)
corrcoeff_has_transaction_age

#главная функция
def power_of_connection(coeff_corr_general):
    if coeff_corr_general < 0.1:
        corr_pow = "отсутствует"
    elif 0.1 <= coeff_corr_general <= 0.3:
        corr_pow = "слабая"
    elif 0.3 < coeff_corr_general <= 0.5:
        corr_pow = "умеренная, средняя"
    elif 0.5 < coeff_corr_general <= 0.7:
        corr_pow = "заметная, средняя"
    elif 0.7 < coeff_corr_general <= 0.9:
        corr_pow = "высокая, сильная"
    elif 0.9 < coeff_corr_general <= 1:
        corr_pow = "весьма высокая, сильная"
    else:
        corr_pow = ("ошибка")
    return(corr_pow)

print("Коэффициент корреляции между возрастом и совершением транзакции, равен", corrcoeff_has_transaction_age,
", а сила взаимосвязи -", power_of_connection(corrcoeff_has_transaction_age))

